import React from 'react';

// Dashboards
const Dashboard = React.lazy(() => import('./pages/Dashboards/Dashboardv1/Dashboard'));
const Dashboardv2 = React.lazy(() => import('./pages/Dashboards/Dashboardv2'));
const Dashboardv3 = React.lazy(() => import('./pages/Dashboards/Dashboardv3'));

// Acessos
const Logon = React.lazy(() => import('./pages/Acessos/Logon'));
const Modulo = React.lazy(() => import('./pages/Acessos/Modulo'));
const Pagina = React.lazy(() => import('./pages/Acessos/Pagina'));
const Password = React.lazy(() => import('./pages/Acessos/Password'));
const PerfilAcesso = React.lazy(() => import('./pages/Acessos/PerfilAcesso'));
const PermissaoAcesso = React.lazy(() => import('./pages/Acessos/PermissaoAcesso'));
const Register = React.lazy(() => import('./pages/Acessos/Register'));
const Usuario = React.lazy(() => import('./pages/Acessos/Usuario'));

// Atividades 
const Anotacoes = React.lazy(() => import('./pages/Atividades/Atividades'));
const Atividades = React.lazy(() => import('./pages/Atividades/Anotacoes'));
const Oportunidades = React.lazy(() => import('./pages/Atividades/Oportunidades'));

// Configurações
const Cargos = React.lazy(() => import('./pages/Configuracoes'));
const Clientes = React.lazy(() => import('./pages/Configuracoes'));
const Contatos = React.lazy(() => import('./pages/Configuracoes'));
const Departamentos = React.lazy(() => import('./pages/Configuracoes'));
const Distribuidores = React.lazy(() => import('./pages/Configuracoes'));
const ExpectativasFechamento = React.lazy(() => import('./pages/Configuracoes'));
const FasesPipe = React.lazy(() => import('./pages/Configuracoes'));
const Marcas = React.lazy(() => import('./pages/Configuracoes'));
const Metas = React.lazy(() => import('./pages/Configuracoes'));
const MetasVendedores = React.lazy(() => import('./pages/Configuracoes'));
const MotivosPerda = React.lazy(() => import('./pages/Configuracoes'));
const Paises = React.lazy(() => import('./pages/Configuracoes'));
const Pipes = React.lazy(() => import('./pages/Configuracoes'));
const Produtos = React.lazy(() => import('./pages/Configuracoes'));
const SegmentosMercado = React.lazy(() => import('./pages/Configuracoes'));
const TiposAtividade = React.lazy(() => import('./pages/Configuracoes'));
const TiposContato = React.lazy(() => import('./pages/Configuracoes'));


const routes = [

  // Dashboards
  { path: '/', exact: true, name: 'Home' },
  { path: '/dashboardv1', name: 'Dashboard', component: Dashboard },
  { path: '/dashboardv2', name: 'Dashboardv2', component: DashBoardv2 },
  { path: '/dashboardv3', name: 'Dashboardv3', component: Dashboardv3 },

  // Acessos
  { path: '/logon', name: 'Logon', component: Logon },
  { path: '/modulo', name: 'Modulo', component: Modulo },
  { path: '/pagina', name: 'Pagina', component: Pagina },  
  { path: '/perfil-acesso', name: 'PerfilAcesso', component: PerfilAcesso },
  { path: '/permissao-acesso', name: 'PermissaoAcesso', component: PermissaoAcesso },
  { path: '/register', name: 'Register', component: Register },
  { path: '/usuario', name: 'Usuario', component: Usuario },

  //Atividades
  { path: '/anotacoes', name: 'Anotacoes', component: Anotacoes },
  { path: '/atividades', name: 'Atividades', component: Atividades },
  { path: '/oportunidades', name: 'Oportunidades', component: Oportunidades },


  //Configuração
  { path: '/cargos', name: 'Logon', component: Cargos },
  { path: '/clientes', name: 'Logon', component: Clientes },
  { path: '/contatos', name: 'Logon', component: Contatos },
  { path: '/departamentos', name: 'Logon', component: Departamentos },
  { path: '/distribuidores', name: 'Logon', component: Distribuidores },
  { path: '/expectativas-fechamento', name: 'Logon', component: ExpectativasFechamento },
  { path: '/fases-pipe', name: 'Logon', component: FasesPipe },
  { path: '/marcas', name: 'Logon', component: Marcas },
  { path: '/metas', name: 'Logon', component: Metas },
  { path: '/metas-vendedores', name: 'Logon', component: MetasVendedores },
  { path: '/motivos-perda', name: 'Logon', component: MotivosPerda },
  { path: '/paises', name: 'Logon', component: Paises },
  { path: '/pipes', name: 'Logon', component: Pipes },
  { path: '/produtos', name: 'Logon', component: Produtos },
  { path: '/segmentos-mercado', name: 'Logon', component: SegmentosMercado },
  { path: '/tipos-atividade', name: 'Logon', component: TiposAtividade },
  { path: '/tipos-contato', name: 'Logon', component: TiposContato },
];

export default routes;
